// src/administrador/componentes/SidebarAdmin.js
import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import { FaTachometerAlt, FaUsers, FaParking, FaFileAlt, FaTools, FaBell, FaEnvelope, FaCalendarAlt, FaShieldAlt, FaFileContract, FaQuestionCircle, FaCog, FaUser, FaBuilding, FaUserTie } from 'react-icons/fa';
import logo from '../../assets/logo.png';
import './SidebarAdmin.css';

const SidebarAdmin = ({ isCollapsed, toggleSidebar }) => {
    const location = useLocation();

    const navItems = [
        { icon: <FaTachometerAlt />, label: 'Dashboard', path: '/dashboard' },
        { icon: <FaUsers />, label: 'Residentes', path: '/residentes' },
        { icon: <FaParking />, label: 'Cocheras', path: '/cocheras' },
        { icon: <FaFileAlt />, label: 'Reportes', path: '/reportes' },
        { icon: <FaTools />, label: 'Mantenimiento', path: '/mantenimiento' },
        { icon: <FaBell />, label: 'Notificaciones', path: '/notificaciones' },
        { icon: <FaEnvelope />, label: 'Correspondencia', path: '/correspondencia' },
        { icon: <FaCalendarAlt />, label: 'Eventos', path: '/eventos' },
        { icon: <FaShieldAlt />, label: 'Accesos', path: '/accesos' },
        { icon: <FaFileContract />, label: 'Documentos', path: '/documentos' },
        { icon: <FaBuilding />, label: 'Áreas comunes', path: '/areas-comunes' },
        { icon: <FaUserTie />, label: 'Empleados', path: '/empleados' },
    ];

    const footerItems = [
        { icon: <FaQuestionCircle />, label: 'Soporte', path: '/soporte' },
        { icon: <FaCog />, label: 'Configuración', path: '/configuracion' },
        { icon: <FaUser />, label: 'Usuario', path: '/usuario' },
    ];

    return (
        <div className={`sidebar bg-primary text-white d-flex flex-column ${isCollapsed ? 'collapsed' : ''}`}>
            <div className="sidebar-header d-flex align-items-center p-3 border-bottom">
                <button className="btn btn-light me-2" onClick={toggleSidebar}>
                    {isCollapsed ? <span className="material-icons">menu</span> : <span className="material-icons">menu_open</span>}
                </button>
                <img src={logo} alt="Parques de la Huaca Logo" className="sidebar-logo rounded-circle me-2" />
                {!isCollapsed && <h3 className="m-0">Parques de la Huaca</h3>}
            </div>
            <div className="sidebar-main-content flex-grow-1">
                <ul className="nav flex-column">
                    {navItems.map((item, index) => (
                        <li key={index} className={`nav-item ${location.pathname === item.path ? 'active bg-dark' : ''}`}>
                            <Link to={item.path} className="nav-link text-white d-flex align-items-center p-3">
                                <span className="me-2">{item.icon}</span>
                                {!isCollapsed && <span>{item.label}</span>}
                            </Link>
                        </li>
                    ))}
                </ul>
            </div>
            <div className="sidebar-footer p-3 border-top">
                <ul className="nav flex-column">
                    {footerItems.map((item, index) => (
                        <li key={index} className="nav-item">
                            <Link to={item.path} className="nav-link text-white d-flex align-items-center p-2">
                                <span className="me-2">{item.icon}</span>
                                {!isCollapsed && <span>{item.label}</span>}
                            </Link>
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );
};

export default SidebarAdmin;
